import React from "react"

class ButtonContainer extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoading: false
    }
  }

  onLoading = () => {
    this.setState({
      isLoading: !this.state.isLoading
    })
  }

  render() {
    return (
      <Button onLoading={() => this.onLoading}/>
    )
  }
}

import {Button} from "./Button.component";
